import React from 'react';
import styled from 'styled-components';

const HeaderDividerBlock = styled.div`
  display: flex;
  flex-direction: column;
  background-color: #007bec;
  text-align: center;
  padding-top: 36px;
  padding-bottom: 43px;
`;

const DividerBlockColumn = styled.div`
  font-size: 30px;
  &:nth-child(1) {
    text-emphasis: filled sesame;
    font-size: 40px;
  }
`;

const HeaderDivider = () => (
  <HeaderDividerBlock>
    <DividerBlockColumn>하지만</DividerBlockColumn>
    <br />
    <DividerBlockColumn>
      코더스하이 실시간 원격 코스는 다릅니다
    </DividerBlockColumn>
  </HeaderDividerBlock>
);

export default HeaderDivider;
